class KycDetailsData {
  KycStatusData? kyc;
  String? kycStatus;
  String? kycRejectionReasons;
  String? kycDate;
  String? kycVerificationMode;

  KycDetailsData(
      {this.kyc,
      this.kycStatus,
      this.kycRejectionReasons,
      this.kycDate,
      this.kycVerificationMode});

  KycDetailsData.fromJson(Map<String, dynamic> json) {
    kyc = json['kyc'] != null ? KycStatusData.fromJson(json['kyc']) : null;
    kycStatus = json['kyc_status'];
    kycRejectionReasons = json['kyc_rejection_reasons'];
    kycDate = json['kyc_date'];
    kycVerificationMode = json['kyc_verification_mode'];
  }

  Map<String, dynamic> toJson() {
    final Map<String, dynamic> data = <String, dynamic>{};
    if (kyc != null) {
      data['kyc'] = kyc!.toJson();
    }
    data['kyc_status'] = kycStatus;
    data['kyc_rejection_reasons'] = kycRejectionReasons;
    data['kyc_date'] = kycDate;
    data['kyc_verification_mode'] = kycVerificationMode;
    return data;
  }
}

class KycStatusData {
  String? status;
  List<String>? pendingDocuments;
  List<String>? pendingData;

  KycStatusData({this.status, this.pendingDocuments, this.pendingData});

  KycStatusData.fromJson(Map<String, dynamic> json) {
    status = json['status'];
    pendingDocuments = json['pending_documents'].cast<String>();
    pendingData = json['pending_data'].cast<String>();
  }

  Map<String, dynamic> toJson() {
    final Map<String, dynamic> data =  <String, dynamic>{};
    data['status'] = status;
    data['pending_documents'] = pendingDocuments;
    data['pending_data'] = pendingData;
    return data;
  }
}
